import { Link } from "react-router-dom";
import AdminHeader from "../components/AdminHeader";

const ContentSelect=()=>{
    return(
<div className="AdminEntire">
    <AdminHeader/>
    <div className="">
        <div>키워드 관리</div>
        <div>문제의 키워드를 관리할 수 있다.</div>
        <Link to="">관리하러가기</Link>
    </div>
    <div>
        <div>과목 관리</div>
        <div>문제들의 과목들을 관리할 수 있다.</div>
        <Link to="">관리하러가기</Link>
    </div>
    <div>
        <div>회차 관리</div>
        <div>문제들의 회차들을 관리할 수 있다.</div>
        <Link to="">관리하러가기</Link>
    </div>
</div>
    )
};
export default ContentSelect;
